import React from 'react';
import Home from './components/home/Home';
import { Link } from 'react-router-dom'

export default function App() {
  return (
    <>
      <header>
        <nav>
          <Link to="/">Home</Link>
          <Link to="/"></Link>
        </nav>
      </header>
      <Home/>
    </>
  )
}
